import React, {Component} from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

// Screens
import {MenuDeOpciones} from "../Screens/MenuDeOpciones";

const Stack = createStackNavigator();

export default class StackMenu extends Component {
  
  render(){
    return (

      <NavigationContainer>
          <Stack.Navigator initialRouteName="MenuDeOpciones">
          <Stack.Screen name="MenuDeOpciones" component={MenuDeOpciones} />
          <Stack.Screen name="Home" component={HomeScreen} options={{title:"Inicio"}}/>
          <Stack.Screen name="Details" component={DetailsScreen} options={{title:"Detalles"}}/>
          <Stack.Screen name="Notifications" component={Notifications} />
        </Stack.Navigator>
      </NavigationContainer>
    );
  }

}
